import { useLocation } from 'react-router-dom';

function ShowContent() {
 const location = useLocation();
    const mycontent = location.state.content
    console.log(mycontent)
    return (
        <div>
            {mycontent.map(content => {
                return (
                    <h1>{content.title}</h1>
                )
            })}
        </div>
    )
}

export default ShowContent
